import { Helmet } from 'react-helmet-async';
import { Link as RouterLink } from 'react-router-dom';
// @mui
import { Link, Stack, Container, Typography } from '@mui/material';
// routes
import { PATH_AUTH } from '../routes/paths';
// components
import Iconify from '../components/iconify';
import { useSettingsContext } from '../components/settings';
// sections
import AuthChangePasswordForm from '../sections/auth/AuthChangePasswordForm';
// assets
// import { PasswordIcon } from '../../assets/icons';

// ----------------------------------------------------------------------

export default function ResetPasswordPage() {
    const { themeStretch } = useSettingsContext();

    return (
        <>
            <Helmet>
                <title> Reset Password | Minimal UI</title>
            </Helmet>

            {/* <PasswordIcon sx={{ mb: 5, height: 96 }} /> */}

            <Container maxWidth={themeStretch ? false : 'xl'}>
                <Stack sx={{ width: 5, paddingTop: 0 }}>
                    <Stack spacing={2} sx={{ mb: 5, position: 'relative' }}>
                        <Typography variant="h3" paragraph>
                            Change password
                        </Typography>

                        <Typography sx={{ color: 'text.secondary', mb: 5 }}>
                            Please enter the email address associated with your account and We will email you a link to
                            reset your password.
                        </Typography>

                        <AuthChangePasswordForm />
                    </Stack>
                </Stack>
            </Container>
        </>
    );
}
